/*Table structure for table `tblPrivateService` */

DROP TABLE IF EXISTS `tblPrivateService`;

CREATE TABLE `tblPrivateService` (
  `no` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Primary Key',
  `uniqueCode` varchar(512) NOT NULL COMMENT 'User Unique Code ID',
  `name` varchar(128) DEFAULT NULL COMMENT 'User Name',
  `birth` datetime DEFAULT NULL COMMENT 'User Birth',
  `sex` tinyint(4) DEFAULT NULL COMMENT 'Sexual Information (0:Male, 1:Female, 2:Etc)',
  `phone` varchar(128) DEFAULT NULL COMMENT 'User Phone Number',
  `addrPost` varchar(64) DEFAULT NULL COMMENT 'Addr Post Code',
  `addr` varchar(512) DEFAULT NULL COMMENT 'Addr detail',
  `dept` varchar(512) DEFAULT NULL COMMENT 'User Occupation or scholar information',
  `regDate` datetime DEFAULT NULL COMMENT 'Registration Date',
  PRIMARY KEY (`no`)
) ENGINE=MyISAM DEFAULT CHARSET=euckr;

