  `no` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Primary Key',
  `desc` varchar(128) NOT NULL COMMENT 'Description',
  `meaning` varchar(10) NOT NULL COMMENT 'SEC, MIN, HOUR, DAY, MON, YR',
  `diff` int(11) NOT NULL DEFAULT '0' COMMENT 'Diff (0 : None)',
  `standalone` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'StandAlone',
  `regDate` datetime DEFAULT NULL COMMENT 'Registration Date',
  PRIMARY KEY (`no`)
) ENGINE=MyISAM AUTO_INCREMENT=35 DEFAULT CHARSET=euckr;

